import React from "react";


const ListItems = (props) =>{
     
    return (
        <>
            <div className="List_style">
            <i class="fa fa-times" aria-hidden="true" onClick={()=>{
                props.onSelect(props.id)
            }}></i>
            
                <li>{props.text}</li>
            </div>
        </>
    )
}

export default ListItems;
